import styles from "./Mainpage.module.css"
import React, { useEffect, useState } from 'react';
import Footer from "../../components/_Layout/Footer";
import HeaderImg from '../../image/nail.png';


export default function Home() {    
    const [recommendUser, setRecUser] = useState([]);
    const [recommendPj, setRecPj] = useState([]);
    const [suggestPj, setsgPj] = useState([]);
    let token = localStorage.getItem('token') || '';
    localStorage.setItem('checkPost', JSON.stringify(''))
    useEffect(() => {
        const fetchData1 = async() => {
            try {
                fetch('/member/recommend', {
                    method: 'POST', 
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`
                    },
                })
                .then(res=>res.json())        
                .then(res=> {
                    setRecUser(res);
                });
            } catch (error) {
                console.error("안됨: ", error);
            }
        };

        const fetchData = async() => {
            try {
                fetch('/recruitPost/recommend', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`
                    },
                })     
                .then(res=> {
                    if (res.status === 400) {
                        alert(`400 Error in recommend post`);
                        return;
                    }
                    if(res.status === 404){
                        alert(`포스트 영개`);
                        return;
                    }
                    return res.json();
                }).then(data => {
                    setRecPj(data);
                    console.log(data)
                })
            } catch (error) {
                console.error("Failed to fetch: ", error);
            }
        };
        const fetchData2 = async() => {
            try {
                fetch('/recruitPost/suggest', {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                        'Authorization': `Bearer ${token}`
                    },
                })     
                .then(res=> {
                    if (res.status === 400) {
                        alert(`400 Error in suggest post`);
                        return;
                    }
                    if(res.status === 404){
                        alert(`포스트 영개`);
                        return;
                    }
                    return res.json();
                }).then(data => {
                    setsgPj(data);
                })
            } catch (error) {
                console.error("Failed to fetch: ", error);
            }
        };
        fetchData1();   
        fetchData(); 
        fetchData2();
    }, []);
  return (
    <div className={styles.default}>
        
        
        <div className={styles.cropping}>
            <img className={styles.headerImg} src={HeaderImg}/>
        </div>
        <div className={styles.inner}>
            2024 KBO
            다가오는 경기


            <table >
                <thead>
                    <tr>
                        <th className={styles.th}>제목</th>
                        <th>날짜</th>
                        <th>위치</th>
                        <th>팀</th>
                        <th>상대팀</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td className={styles.td}>
                            <div className={styles.content}>박찬호 홈런ㅋㅋㅋㅋ
                            </div>
                        </td>
                        <td className={styles.td}>
                            <div className={styles.content}>2024-02-30
                            </div>
                        </td>
                        <td className={styles.td}>
                            <div className={styles.content}>광주 챔피언스필드
                            </div>
                        </td>
                        <td className={styles.td}>
                            <div className={styles.content}>KIA
                            </div>
                        </td>
                        <td className={styles.td}>
                            <div className={styles.content}>LG
                            </div>
                        </td>
                    </tr>
                    <tr>
                        <td>도.니.살</td>
                        <td>2024-11-20</td>
                        <td>집관</td>
                        <td>KIA</td>
                        <td>삼성</td>
                    </tr>
                </tbody>
        </table>
        </div>
        <Footer />
    </div>
);
}
